import React, { Component } from 'react';
import './index.less';

export default class Header extends Component {
    render() {
        return (
            <div className="header">
                <div className="header-top">
                    <span>Hello, admin</span>
                    <a href="javascript:">Logout</a>
                </div>
                <div className="header-bottom">
                    <div className="header-bottom-left">Main Page</div>
                    <div className="header-bottom-right">

                    <a class="weatherwidget-io" href="https://forecast7.com/en/n33d87151d21/sydney/" data-label_1="SYDNEY" data-label_2="WEATHER" data-icons="Climacons Animated" data-days="3" data-theme="pure">
                        SYDNEY WEATHER
                    </a>
                    { 
                        !function(d,s,id){
                            var js,fjs=d.getElementsByTagName(s)[0];
                            if(!d.getElementById(id)){
                                js=d.createElement(s);
                                js.id=id;js.src='https://weatherwidget.io/js/widget.min.js';
                                fjs.parentNode.insertBefore(js,fjs);
                            }
                        }(document,'script','weatherwidget-io-js')
                    }

                        <span>18 Oct 2019</span>
                        <img src="" />
                        <span>Sunny</span>
                    </div>
                </div>
            </div>
        )
    }
}
